import React, { ReactNode } from 'react';
import Head from 'next/head';
import { Container } from '../styles/PaymentWizard';
import { Layout, Row, Col } from 'antd';

type Props = {
  children?: ReactNode;
  title?: string;
};

const WizardLayout: React.FC<Props> = ({ children, title }) => {
  const { Header, Content, Footer } = Layout;
  return (
    <React.Fragment>
      <Head>
        <title>{title}</title>
        <meta charSet="utf-8" />
        <meta name="viewport" content="initial-scale=1.0, width=device-width" />
      </Head>
      <Layout>
        <Header>
          <Container className="container bg-white">{children}</Container>
        </Header>
      </Layout>
    </React.Fragment>
  );
};

export { WizardLayout };
